import React from 'react'
import {episodes} from './../data/podcastData'



function PodcastList() {



  return (    <div>
        <h2>Podcast Publicados </h2>
        <ul>
            {episodes.map( (itm)=>{


                    const {id, title,link, desc, temas} =itm;
                    return                (
                <li key={id}>
                    <h3>{title}</h3>
                    <a href={link} > link al episodio </a>
                    <p>{desc}</p>
                    <p> {temas}</p>


                </li> )

            })}


        </ul>




        </div>
  )
}




export default PodcastList
